import React from 'react'
import props from 'prop-types'
import { Box, Card, Image, Heading, Text } from 'rebass'
import bunkerDownImage from '../images/600x900BunkerDown.png'
import dInfinityImage from '../images/MortyArchmage.png'

var projects = {"Bunker Down": {"name": "Bunker Down", "type":"Video Game", "image":bunkerDownImage},
                    "DInfinity": {"name": "DInfinity", "type":"Video Game", "image":dInfinityImage}
                    }
var cards = []

const ProjectCards = () => {
  for (var project in projects) {
    cards.push(getProjectCard(project))
  }
  return (cards)
}

function getProjectCard(project) {
  return (
    <Box width={256} mx='auto'>
      <Card
        sx={{
          p: 1,
          borderRadius: 2,
          boxShadow: '0 0 16px rgba(0, 0, 0, .25)',
        }}>
        <Image src={projects[project]["image"]} sx={{height:"50px"}}/>
        <Box px={2}>
          <Heading as='h3'>
            {project}
          </Heading>
          <Text fontSize={0}>
            {projects[project]["type"]}
          </Text>
        </Box>
      </Card>
    </Box>
  )

}

export default ProjectCards;
